import React, { Component } from 'react';
import 'antd/dist/antd.css';

import CustomLayout from './containers/Layout';
import StudentList from './containers/StudentListView';

class App extends Component {
  render() {
    return (
      <div className="App">
        <CustomLayout>
          <StudentList />
        </CustomLayout>
      </div>
    );
  }
}

export default App;
